import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTrash } from '@fortawesome/free-solid-svg-icons';
import { faSquare } from '@fortawesome/free-solid-svg-icons';

function ListContainer(props) {


    function handleDelete(id){
        console.log(id);
    }

    var listItemState = '';
    if(props.state.currentState === 0){
        listItemState = "Bucket List";
    }
    else{
        listItemState = "Todo List";
    }
    if(props.state.currentListItems.length > 0){
        return(
            props.state.currentListItems.map((item, index) => {
                return(
                    <div class="list-item">
                    <div class="type">
                      {listItemState}
                    </div>
                    <div class="listTitle">
                      {item.itemTitle}
                    </div>
                    <div class="listBody">
                      {item.caption}
                    </div>
                    <div class="complete" onClick={handleDelete(item._id)}><FontAwesomeIcon icon={faSquare}/></div>
                    <div class="removeListItem"><FontAwesomeIcon icon={faTrash}/></div>
                    </div>
                )
            })
        )
    }
return(
    <>
    </>
)
}

export default ListContainer
